import React from "react"
import { Container, Row, Col, Table, Button } from "react-bootstrap";

function Checkout() {
    return (
        <>
            <Container>
                <Row>
                    <Col>
                        <h1>Checkout</h1>

                        <h2>Shipping Details:</h2>
                    </Col>
                </Row>
            </Container>
        </>
    )
}

export default Checkout;
